import { useEffect } from "react";
import Tableau from "./Tableau";

function Parent() {
  const [tableauData, setTableauData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios
      .get("http://localhost:3000/training-courses")
      .then((response) => {
        setTableauData(response.data);
        setLoading(false);
      })
      .catch((err) => {
        console.error(err);
        setLoading(false);
      });
  }, []);

  return (
    <div>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <Tableau tableau={tableauData} />
      )}
    </div>
  );
}
